import React, { useEffect, useState } from "react";
import axios from "axios";

function Image() {
  const [images, setImages] = useState([]);
  const [pageIndex,setPageIndex] = useState(0);

  const showImages = () => {
    axios
      .get(
        "https://www.flickr.com/services/rest/?method=flickr.photos.search&api_key=f5e3dc5e6886a1e7799eeb85aad99cb5&texts=chennai&per_page=20&page=1&format=json&nojsoncallback=1"
      )
      .then((response) => {
          console.log(response)
        setImages(response.data.photos.photo);

      });
  };
  useEffect(() => {
    // Update the document title using the browser API
    showImages();
  }, []);
  console.log(images);
  // const srcPath = 'https://farm'+pic.farm+'.staticflickr.com/'+pic.server+'/'+pic.id+'_'+pic.secret+'.jpg';

  return (
    <div>
        {images.map((image) => {
           let srcPath =  'https://farm'+image.farm+'.staticflickr.com/'+image.server+'/'+image.id+'_'+image.secret+'.jpg';
           return(
               <img src = {srcPath} ></img>
           );

        })}
    </div>
  );
}

export default Image;
